script: |
  super -f text -I q5128.spq | sort > q5128.out

inputs:
  - name: q5128.spq
    data: |
      SELECT col2 + - 11 FROM tab1 (FORMAT parquet) WHERE NOT - CAST ( + col2 AS INTEGER ) + col1 NOT BETWEEN col1 AND ( col0 / - 34 + + col1 * col2 );
  - name: tab1

outputs:
  - name: q5128.out
    data: |
